import React from "react";
import Internships from "./Internships.jsx";
import SkillsBar from "./SkillsBar.jsx";

function Experience() {
    return (
        <Container>
            <Row>
                <Col>
                    <SkillsBar />
                </Col>

                <Col>
                    <Internships />
                </Col>
            </Row>
        </Container>
    )
}

export default Experience;
